DROP TABLE IF EXISTS `xds_callback`;
CREATE TABLE `xds_callback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `key_id` char(36) NOT NULL DEFAULT '关联ID',
  `user_id` char(36) NOT NULL DEFAULT '',
  `key_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0 GO 1 反馈',
  `deadline` int(11) NOT NULL DEFAULT '0' COMMENT '任务完成截止时间戳',
  `status` enum('0','1') NOT NULL DEFAULT '0' COMMENT '是否已结束 0 否 1 是',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `key_id` (`key_id`,`user_id`,`key_type`,`deadline`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='定时-回调任务表';

