  KEY `comment_post_ID` (`communication_id`),
  KEY `comment_approved_date_gmt` (`status`),
  KEY `table_id_status` (`communication_id`,`status`),
  KEY `createtime` (`create_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='评论表';

